import React from 'react';
import { Table, Icon } from 'antd';

const columns = [
    {
      title: 'Nombre',
      dataIndex: 'name',
    },
    {
      title: 'Desde',
      dataIndex: 'startTime',
    },
    {
      title: 'Hasta',
      dataIndex: 'endTime',
    },
    {
      title: 'Borrar',
      render: <Icon type='delete'/>
    }
  ];

const CustomTable = (props) => {
    const {data} = props;
    return (
      <Table columns={columns} dataSource={data} pagination={false}/>
    );
};

export default CustomTable;
